import React from "react";
import Pokecard from "./Pokecard";
const Pokedex = ({ pokemons }) => {
  return (
    <>
      {pokemons.map((pokemon) => (
        <Pokecard
          key={pokemon.id}
          id={pokemon.id}
          name={pokemon.name}
          type={pokemon.type}
          baseExperience={pokemon.base_experience}
        />
      ))}
    </>
  );
};
export default Pokedex;
